const Content = (prop) => {
  return (
    <tbody>
      <tr>
        <td>{prop.data.year}</td>
        <td>{prop.data.totalSaving}</td>
        <td>{prop.data.interest}</td>
        <td></td>
        <td></td>
      </tr>
    </tbody>
  );
};

export default Content;
